const arr = [];

const visit = [];

for (let i = 0; i < 1000; i++) {
  const visitSub = [];
  const arrSub = [];
  for (let j = 0; j < 1000; j++) {
    arrSub.push("");
    visitSub.push(false);
  }
  arr.push(arrSub);
  visit.push(visitSub);
}

const parser = new DOMParser();
const doc = parser.parseFromString(html, "text/html");

const trs = doc.querySelectorAll("tr");
trs.forEach((element, index) => {
  const tds = element.querySelectorAll("td");
  tds.forEach((td, i) => {
    if (td.innerText == "x") {
      arr[index][i] = "█";
    }
    if (td.innerText == "c") {
      arr[index][i] = "░";
    }
  });
});

const table = document.createElement("table");
let count = 0;
while (count < 1000*1000) {
  let ranX = Math.floor(Math.random() * 1000);
  let ranY = Math.floor(Math.random() * 1000);
  if (!visit[ranX][ranY]) {
    count ++;
    visit[ranX][ranY] = true;
    if (arr[ranX][ranY] !== "") {
      const row = document.createElement("tr");
      const cell1 = document.createElement("td");
      cell1.innerHTML = `<span>${ranX}</span>`;
      const cell2 = document.createElement("td");
      cell2.innerHTML = `<span>${ranY}</span>`;
      const cell3 = document.createElement("td");
      cell3.innerHTML = `<span>${arr[ranX][ranY]}</span>`;
      row.appendChild(cell2);
      row.appendChild(cell3);
      row.appendChild(cell1);
      table.appendChild(row);
    }
  }
}
document.querySelector("#data").appendChild(table);
